import React,{useState} from 'react'


const Login = () => {
    const [credentials, setCredentials] = useState({email: "", password: ""})

    const onChangelogin = () => {
      setCredentials({...credentials, [e.target.name]: e.target.value})
    }
  return (
    <div>
        <form>
            <div>
                <input className="uname-input login-input"  onChange={onChangelogin}  value={credentials.email} type="text"  name="username"/>
            </div>
            <div>
                 <input className="pwd-input login-input"  onChange={onChangelogin}  value={credentials.password} type="text"  name="password"/>
            </div>
        </form>
    </div>
  )
}

export default Login
